import { useNavigate } from "react-router-dom";

function CardPage({ card }) {
  const navigate = useNavigate();

  return (
    <>
      <model-viewer
        className="model"
        alt=""
        src="./bathroom2.glb"
        camera-controls
        touch-action="pan-y"
      ></model-viewer>
    </>
  );
}

export default CardPage;
